CREATE TABLE `tramites` (
  `idtramites` int(11) NOT NULL AUTO_INCREMENT,
  `tipoTramite` varchar(45) DEFAULT NULL,
  `estado` varchar(45) DEFAULT NULL,
  `fechaTramite` date DEFAULT NULL,
  `fechaEntrega` date DEFAULT NULL,
